      function tanhlookup(v){
            if (v>=2) return 1;
            if (v<=-2) return -1;
            if (v<0)
              return (0-tanhlookuptable[((0-v)*512)|0])/(255*255.0)
            return (tanhlookuptable[(v*512)|0])/(255*255.0)
      }
      
    
      function scalelin(scale,min,max){
        return min+(max-min)*scale;
      }

      function scalelog(scale,min,max){
        return Math.exp(Math.log(min) + (Math.log(max)-Math.log(min))*scale);
      }

      function run(){
        w=800;
        h=600;
        config =  {

        };

        kernel_size=21;

        kernel[0] = [0.000001,0.000009,0.000075,0.000476,0.002359,0.009135,0.027646,0.065407,0.120983,0.174973,0.197872,0.174973,0.120983,0.065407,0.027646,0.009135,0.002359,0.000476,0.000075,0.000009,0.000001]
        kernel[1] = [0.000959,0.002419,0.005532,0.011479,0.02161,0.036908,0.05719,0.0804,0.102547,0.118665,0.124582,0.118665,0.102547,0.0804,0.05719,0.036908,0.02161,0.011479,0.005532,0.002419,0.000959]
        gaus=[]

        gaus[1] =  new Uint16Array(new ArrayBuffer(w*h*2));
        
        buf= new Uint16Array(new ArrayBuffer((Math.max(w,h)+kernel_half*2)*2))
        
        for(g=0;g<2;g++){
          
          for(ls=0;ls<w*h;ls+=w)
          {
            //fill buffer            
            v=image.data[ls]*256;
            for(b=0;b<kernel_half;b++){
              buf[b]=v;
            }            
            for(b=0;b<w;b++){
              buf[kernel_half+b]=image.data[ls+b]*256;
            }
            v=image.data[ls+w-1];
            for(b=0;b<kernel_half;b++){
              buf[kernel_half+w+b]=v;
            }
            //convolution
            for(p=0;p<w;p++){
              sum=0.0;
              for(k=0;k<kernel_size;k++){
                sum+=buf[p+k]*kernel[g][k];
              }
              gaus[g][ls+p]=sum;
            }          
          }
          
          for(rs=0;rs<w;rs+=1)
          {
            //fill buffer
            v=gaus[g][rs];
            for(b=0;b<kernel_half;b++){
              buf[b]=v;
            }
            for(b=0;b<h;b++){
              buf[kernel_half+b]=gaus[g][rs+b*w];
            }
            v=gaus[g][rs+(h-1)*w];
            for(b=0;b<kernel_half;b++){
              buf[kernel_half+h+b]=v;
            }
            //convolution
            for(p=0;p<h;p++){
              sum=0.0;
              for(k=0;k<kernel_size;k++){
                sum+=buf[p+k]*kernel[g][k];
              }
              gaus[g][rs+p*w]=sum;
            }          
          }
          
        }
        
        var farray1 = new jsfeat.matrix_t(canvas.width, canvas.height, jsfeat.F32_t | jsfeat.C1_t);
        for (var i=0; i<canvas.width*canvas.height;i++){
          farray1.data[i]=(gaus[0][i]-(gamma*gaus[1][i]))/(256*256.0)
        }
        for (var i=0; i<canvas.width*canvas.height;i++){
          if(farray1.data[i] < -0.1){
            farray1.data[i]=1;
          }
          else{
            farray1.data[i]=1+tanhlookup(phi*farray1.data[i]);
          }
        }
        //we need the mean ;-(
        var mean=0;
        for (var i=0; i<canvas.width*canvas.height;i++){
          mean+=farray1.data[i];
        }
        mean=mean/(w*h);
        
        bw =  new Uint8Array(new ArrayBuffer(w*h/4)); //2 bits per pixsel
        mask=[0b11111100,0b11110011,0b11001111,0b00111111]
        function bw_set(x,y,v){
          pos=x+y*w;
          bw[(pos/4)|0]=(bw[(pos/4)|0] & mask[pos%4]) + ((v & 0b11) << ((pos%4)*2));
        }
        function bw_get(x,y){ 
          pos=x+y*w;
          v=bw[(pos/4)|0]
          if(v==0) return 0;
          if(v==0b01010101) return 1;
          return (v >> ((pos%4)*2)) & 0b11
        }

        for (var hi=0; hi<h;hi++){
          for (var wi=0; wi<w;wi++){
            if(farray1.data[wi+hi*w] < mean){
              bw_set(wi,hi,1);
            }
            else{
              bw_set(wi,hi,0);
            }
          }
        }
        
        //https://lodev.org/cgtutor/floodfill.html
        //The scanline floodfill algorithm using stack instead of recursion, more robust
        function floodFillScanlineStack(x,y)
        {
          //std::vector<int> stack;
          maxstacklength=0;
          stack = []
          stack.push([x,y])
          while(c=stack.pop())
          {
            x=c[0];
            y=c[1];
            x1 = x;
            while(x1 >= 0 && bw_get(x1,y) == 1) x1--;
            //8 Way:
            if(x1 > 0 && y > 0 && bw_get(x1,y-1) == 1)
            {
              stack.push([x1, y - 1]);
            }
            if(x1 > 0 && y < h-1 && bw_get(x1,y+1) == 1)
            {
              stack.push([x1, y + 1]);
            }
            x1++;
            spanAbove = spanBelow = 0;
            while(x1 < w && bw_get(x1,y) == 1)
            {
              bw_set(x1,y,2);
              if(!spanAbove && y > 0 && bw_get(x1,y-1) == 1)
              {
                stack.push([x1, y - 1]);
                spanAbove = 1;
              }
              else if(spanAbove && y > 0 &&  bw_get(x1,y-1) != 1)
              {
                spanAbove = 0;
              }
              if(!spanBelow && y < h - 1 &&  bw_get(x1,y+1) == 1 )
              {
                stack.push([x1, y + 1]);
                spanBelow = 1;
              }
              else if(spanBelow && y < h - 1 && bw_get(x1,y+1) != 1)
              {
                spanBelow = 0;
              }
              x1++;
            }
            //8Way:
            if(x1 < w && y > 0 && bw_get(x1,y-1) == 1)
            {
              stack.push([x1, y - 1]);
            }
            if(x1 < w && y < h-1 && bw_get(x1,y+1) == 1)
            {
              stack.push([x1, y + 1]);
            } 
            if(stack.length> maxstacklength)
              maxstacklength=stack.length;
          }
          console.log("maxstacklength",maxstacklength);
        }    
        
        function searchAndConnect(){
          //test if there is stell something left:
          done=1;
          for(y=0;y<h;y++){
            for(x=0;x<w;x++){
              if(bw_get(x,y)==1){
                done=0;
                break;
              }
            }
            if(done==0)
              break;
          }
          
          if(done) return null;

          //marke new boardes
          for(y=1;y<h-1;y++){
            for(x=1;x<w-1;x++){
              if(bw_get(x,y)==0){
                if(bw_get(x+1,y)==2 || bw_get(x,y+1)==2 || bw_get(x-1,y)==2 || bw_get(x,y-1)==2){
                  bw_set(x,y,3);
                }
              }
            }
          }

          maxr=Math.sqrt(w*w+h*h);
          for (r=0;r<maxr;r++){
            rs=[]
            rx = r;
            ry = 0;
            rd = 1 - r;
            do {
              if(rx<w && ry<h){
                for(c=0;c<8;c++){
                  if(c%2){
                    dx=rx;
                    dy=ry;
                  }
                  else{
                    dx=ry;
                    dy=rx;                  
                  }
                  if(((c/2)|0)%2){
                    dx=0-dx;
                  }
                  if(((c/4)|0)%2){
                    dy=0-dy;
                  }
                  rs.push([dx,dy])
                }
              }
              ry = ry + 1;
              if (rd < 0){
                  rd = rd + 2*ry + 1            
              }
              else
              {
                  rx = rx - 1;
                  rd = rd + 2*(ry-rx) + 1
              }
            } while(rx > ry)          
            
            for(y=0;y<h;y++){
              for(x=0;x<w;x++){
                if(bw_get(x,y)==3){   
                  for(rsi=0;rsi<rs.length;rsi++){
                    dx=rs[rsi][0];
                    dy=rs[rsi][1];
                    if((x+dx)>=0 && (x+dx)<w && (y+dy)>=0 && (y+dy)<h && bw_get(x+dx,y+dy)==1){
                      return [x,y,x+dx,y+dy,r]
                    }                     
                  }
                }
              }
            }
          }
          display();
          return null; 
        }

          var data_u32 = new Uint32Array(imageData.data.buffer);
          var black= (255 << 24) +(0<<16)+(0<<8)+(0<<0) 
          var red  = (255 << 24) +(0<<16)+(0<<8)+(255<<0) 
          var green= (255 << 24) +(0<<16)+(255<<8)+(0<<0) 
          var white= 0; //transparent

          for (var i=0; i<canvas.width*canvas.height;i++){
            switch(bw_get(i%w,(i/w)|0)){
              case 1:
                data_u32[i]=black;
                break;
              case 2:
                data_u32[i]=red;
                break;
              case 3:
                data_u32[i]=green;
                break;
              default:
                data_u32[i]=white;
                break;
            }
            //data_u32[i]=gaus[0][i]/256+(255 << 24);
          }
      
          rctx.putImageData(imageData, 0, 0);
          var ctx=$("#c")[0].getContext('2d');
          ctx.canvas.width=800;
          ctx.canvas.height=600;
          
          ctx.drawImage(rctx.canvas,0,0,800,600,0,0,ctx.canvas.width,ctx.canvas.height);
          
        }
        
       function drawLine(x0, y0, x1, y1){
         dx =  Math.abs(x1-x0)
         sx = x0<x1 ? 1 : -1;
         dy = -Math.abs(y1-y0)
         sy = y0<y1 ? 1 : -1;
         err = dx+dy;  /* error value e_xy */
         while (true){   /* loop */
             bw_set(x0,y0,2);
             if (x0==x1 && y0==y1) break;
             e2 = 2*err;
             if (e2 >= dy) {
                 err += dy /* e_xy+e_x > 0 */
                 x0 += sx;
             }
             if (e2 <= dx){ /* e_xy+e_y < 0 */
                 err += dx
                 y0 += sy
             }
          }
        }
        
        //we need a Line to start from:
        for(i=0;i<w;i++)
          bw_set(i,h-1,1);
        
        floodFillScanlineStack(0,h-1);   
        
        display();
        
        i=0;
        function doOneIter(){
          line=searchAndConnect()
          if (line == null) {
            //remove boarder
            for(y=0;y<h;y++){
              for(x=0;x<w;x++){
                if(bw_get(x,y)==3){
                    bw_set(x,y,0);
                }
                if(bw_get(x,y)==2){
                    bw_set(x,y,1);
                }                               
              }
            }
            display();
            result= bw;
            setTimeout(function(){ floodFillScanlineStack(0,h-1); display();},100);
            return;
          }
          //console.log(i++,line);
          drawLine(line[0],line[1],line[2],line[3]);
          floodFillScanlineStack(line[2],line[3]);  


          display();
          
          setTimeout(doOneIter,1);
       }
       doOneIter();

      }
      function aStart(){
        it+=1000;
        if(aStart_(it))
          return;
        setTimeout(aStart,100);
      }

      function aStart_( iter){
        mask=[0b11111100,0b11110011,0b11001111,0b00111111]                
        w=800;
        h=600;
        bw=  new Uint8Array(new ArrayBuffer(w*h/4)); //2 bits per pixsel
        for(i=0;i<w*h/4;i++)
          bw[i]=testdata[i];

        function bw_set(x,y,v){
          pos=x+y*w;
          bw[(pos/4)|0]=(bw[(pos/4)|0] & mask[pos%4]) + ((v & 0b11) << ((pos%4)*2));
        }
        function bw_get(x,y){ 
          pos=x+y*w;
          v=bw[(pos/4)|0]
          if(v==0) return 0;
          if(v==0b01010101) return 1;
          return (v >> ((pos%4)*2)) & 0b11
        }
        
        function display()
        {
          var rctx=$("<canvas />")[0].getContext('2d');
          rctx.canvas.width=w;
          rctx.canvas.height=h;
          imageData = rctx.getImageData(0, 0, w, h);
          var data_u32 = new Uint32Array(imageData.data.buffer);
          var black= (255 << 24) +(0<<16)+(0<<8)+(0<<0) 
          var red  = (255 << 24) +(0<<16)+(0<<8)+(255<<0) 
          var green= (255 << 24) +(0<<16)+(255<<8)+(0<<0) 
          var white= 0; //transparent

          for (var i=0; i<w*h;i++){
            switch(bw_get(i%w,(i/w)|0)){
              case 1:
                data_u32[i]=black;
                break;
              case 2:
                data_u32[i]=red;
                break;
              case 3:
                data_u32[i]=green;
                break;
              default:
                data_u32[i]=white;
                break;
            }
            //data_u32[i]=gaus[0][i]/256+(255 << 24);
          }
      
          rctx.putImageData(imageData, 0, 0);
          var ctx=$("#c")[0].getContext('2d');
          ctx.canvas.width=800;
          ctx.canvas.height=600;
          
          ctx.drawImage(rctx.canvas,0,0,800,600,0,0,ctx.canvas.width,ctx.canvas.height);
          
        }
        
        x0=$("#start").val()%w;
        y0=($("#start").val()/w)|0;
        x1=$("#stop").val()%w;
        y1=($("#stop").val()/w)|0;

        
        done =  new Uint8Array(new ArrayBuffer(w*h));
        for (i=0;i<w*h;i++)
          done[i]=0;
        cost =  new Uint16Array(new ArrayBuffer(w*h*2));
        for (i=0;i<w*h;i++)
          cost[i]=0;
        //32 bit!!!!!!!!!!!!!!!!!!!!!!!!!
        discoverd =  new Uint32Array(new ArrayBuffer(w*h*2));

        discoverd[0]=x0+y0*w;
        discoverd[1]=w*h; 
        cost[discoverd[0]]=1;
        itcount=0;
        maxdiscoverd=0;
        while (discoverd[0]!=w*h){
          //remove first element:
          current=discoverd[0];
          for (i=0;;i++){
            discoverd[i]=discoverd[i+1];
            if(discoverd[i]==w*h){
              if(i>maxdiscoverd) maxdiscoverd=i;
              break;
            }
          }
          
          
          //process
          x= current%w; 
          y= (current/w)|0;
          bw_set(x,y,3);

          if(x==x1 && y==y1)
            break;
          
          cmin=cost[current];
          for(n=0;n<9;n++){
            dx=n%3==0?1:((n%3==1)?0:-1);
            dy=((n/3)|0)%3==0?1:((((n/3)|0)%3==1)?0:-1);
            next=x+dx +(y+dy)*w;
            if (x+dx>=0 && y+dy>=0 && x+dx<w && y+dy<h && cost[next]!=0){
              c=cost[next]+1;
              if(cmin>c)
                cmin=c;
            }
          }
          cost[current]=cmin;
          
          function heuristic(x,y){
            return 1*(Math.abs(x-x1) + Math.abs(y-y1)) //4 => reduce search time!
          }

          for(n=0;n<9;n++){
            dx=n%3==0?1:((n%3==1)?0:-1);
            dy=((n/3)|0)%3==0?1:((((n/3)|0)%3==1)?0:-1);
            next=x+dx +(y+dy)*w;
            if (x+dx>=0 && y+dy>=0 && x+dx<w && y+dy<h && cost[next]==0 && bw_get(x+dx,y+dy)!=0){
              cost[next]=cost[current]+100; //Higher cost not visited yet!
              c=cost[next] + heuristic(x+dx,y+dy)
              //add to the list
              for(i=0;;i++){
                note=discoverd[i];
                if(note==w*h || cost[note]+heuristic(note%w,(note/w)|0)>c){
                  last=next;
                  for(j=i;;j++){
                    temp=discoverd[j]                  
                    discoverd[j]=last;
                    if(last==w*h)
                      break;
                    last=temp;  
                  }                  
                  break;
                }
              }
            }
          }
          if(itcount++==iter) {
            console.log("maxdiscoverd",maxdiscoverd);
            display();
            return false;
          }
        }
        //Trace back;
        discoverd[0]=x1+y1*w;
        i=0;
        for(;discoverd[i]!=x0+y0*w;i++){
          x=discoverd[i]%w; 
          y=(discoverd[i]/w)|0;
          c=cost[discoverd[i]];
          for(n=0;n<9;n++){
            dx=n%3==0?1:((n%3==1)?0:-1);
            dy=((n/3)|0)%3==0?1:((((n/3)|0)%3==1)?0:-1);
            next=x+dx+(y+dy)*w;
            if (x+dx>=0 && y+dy>=0 && x+dx<w && y+dy<h && cost[next]!=0){
              if(c>cost[next] || (c==cost[next] && (dx==0 || dy==0))){
                c=cost[next];
                discoverd[i+1]=next;
              }
            }
          }
        }

        plength=i;
        for(i=plength;i>=0;i--){
          bw_set(discoverd[i],0,1);
        }       
        
        
        display();
        
        return true;
      
      }
      
    </script>
